window.bookSummaryJSON = "<p><i>Prince of Dogs</i> returns listeners to the war-torn kingdoms of Wendar and Varre and the intertwined destinies of Alain, raised in humble surroundings but now the count's heir; Liath, who struggles to unravel the secrets of her past while evading the traps set for her by those seeking the treasure she hides; Sanglant, believed dead by those who could save him but actually a prisoner in the city of Gent; and Fifth Son, who now builds an army to do his father's bidding - or his own!</p>"; 
